import { useEffect } from 'react'
import { useNavigate } from 'react-router-dom'

export const useErrorNavigator = () => {
  const navigation = useNavigate()
  const navigate = (error_code: any) => {
    if (error_code === 403) {
      navigation('/Error', { state: error_code })
    }
    if (error_code === 500) {
      navigation('/Error')
    }
  }

  return { navigate }
}
